import Current from "./weather/Current";
import Hourly from "./weather/Hourly";
import Daily from "./weather/Daily";

const Forecast = ({forecastData}) => {
    return (
        <div>
            <Current currentData={forecastData.current}/>

            <Hourly />

            <Daily />
        </div>
    )
}

export default Forecast;
